import React from "react";

const TableRowMaker = ({array}) => {
  return (<>{
    array.map((obj)=>(<tr key={obj.examId}>
        <th scope="row">{}</th>
        <td>obj.topicId</td>
        <td>obj.percentage</td>
        <td>obj.topicPassPercentage</td>
        <td>obj.questionsPerTopic</td>
      </tr>))}
    </>
  );
};

export default TableRowMaker;
